import React from "react";
import { BrowserRouter } from 'react-router-dom';
import { Nav } from 'react-bootstrap'

import "../navigation/navigation.css";

class CommunicatorNavigation extends React.Component {
  render() {
    return (
        <BrowserRouter>
            <Nav id="navigation" as="ul" className="navbar navbar-inverse menu-background sht-navbar">
                <Nav.Item>
                    <Nav.Link eventKey="1" href="#/home">
                    NavLink 1 content
                    </Nav.Link>
                </Nav.Item>
                <Nav.Item>
                    <Nav.Link eventKey="2" title="Item">
                    NavLink 2 content
                    </Nav.Link>
                </Nav.Item>
                <Nav.Item>
                    <Nav.Link eventKey="3" disabled>
                    NavLink 3 content
                    </Nav.Link>
                </Nav.Item>
            </Nav>
        </BrowserRouter>
    )
  }
} 

export default CommunicatorNavigation;
